import React from "react";
import Section_image from "./Section_image";
import Section_Image_Carousel from "./Section_Image_Carousel";

const Homepage = () => {
  return (
    <div>
      <Section_image />
      <Section_Image_Carousel/>
      <Section_image />
    </div>
  );
};

export default Homepage;
